INSERT INTO `Remarques` VALUES (1,'C98576','VINCENT LEDOUX','Remarque','Créer un option \"EPI Obligatoires\" en pop-up pour les immersions qui nécessitent les EPI.\r\n','2024-02-16 13:37:02','vincent.ledoux@enedis.fr','En attente de traitement'),(2,'H23453','MARC TREMENT','Remarque','Une évolution à envisager pour plus tard concernant les immersions en AI, si ce n\'est pas prévu, c\'est de mettre une case avec la taille des chaussures et éventuellement de l\'a veste Enedis pour que l\'AI prépare les EPI','2024-02-28 10:24:11','marc.trement@enedis.fr','En attente de traitement'),(3,'H23453','MARC TREMENT','Bug','dans l\'outil sur le menu \"liste des utilisateurs\" il y a une faute de frappe dans le rôle administrateur \"XIB_ADMINISTRARTEUR\" il y a un R en trop','2024-02-28 10:27:06','marc.trement@enedis.fr','En attente de traitement');
