INSERT INTO `vue_agences` VALUES (1,'Grenelle','Expérience Clients','L’Agence Expérience Clients a été créée pour répondre à l’enjeu de la satisfaction des clients de la DR Paris.\r\nRattachée au Service Raccordement Clients Ingénierie, l’agence a pour principal objectif le pilotage de la satisfaction clients, le traitement des réclamations et des saisines issues des médiateurs ainsi que le pilotage de projets relations clients transverses au sein de la DR.\r\n','127 boulevard de Grenelle, 75015 Paris','https://www.google.fr/maps/place/Espace+Grenelle+Enedis/@48.8488603,2.297629,17z/data=!3m1!4b1!4m6!3m5!1s0x47e67022f2d2afb1:0x740f4bb89afe6fa6!8m2!3d48.8488603!4d2.3002039!16s%2Fg%2F11dxqk22gc?entry=ttu','Raccordement Clients et Ingénierie',NULL,'1307761',NULL,NULL),(2,'Grenelle','Accès au réseau de Distribution','L\'agence ARD assure la mission de gestion de l\'accès au réseau de distribution pour ses clients producteurs et consommateurs à enjeux. Par un contact personnalisé, elle s\'assure de leur satisfaction et de la bonne prise en compte de leurs attentes en coordination avec les différentes entités Enedis concernées. L\'ARD gère les contrats CARD-Soutirage et les contrats CARD-injection','22 rue du Laos, 75015 Paris','https://www.google.fr/maps/place/Espace+Grenelle+Enedis/@48.8488603,2.297629,17z/data=!3m1!4b1!4m6!3m5!1s0x47e67022f2d2afb1:0x740f4bb89afe6fa6!8m2!3d48.8488603!4d2.3002039!16s%2Fg%2F11dxqk22gc?entry=ttu','Raccordement Clients et Ingénierie',NULL,'13077683',NULL,NULL),(3,'Grenelle','Acheminement','Le Service Clients d\'Enedis Paris occupe une position centrale en tant que point névralgique pour toutes les demandes émanant des clients envers le distributeur. Ses activités diversifiées englobent la gestion des demandes des fournisseurs d\\\'énergie ainsi que la coordination des activités de relevé en vue de la facturation.\r\nLes missions du Service Clients se distinguent par leur polyvalence :\r\n\r\n- Il prend en charge efficacement les demandes de prestations des fournisseurs, traitant avec expertise les appels téléphoniques associés.\r\n\r\n- Il assume la responsabilité des demandes des clients particuliers ou professionnels de segment C5, démontrant un engagement inébranlable envers la satisfaction client.\r\n\r\n- Il répond aux sollicitations des clients de catégorie C5 par divers moyens tels que téléphone, courrier, e-mail ou site institutionnel, assurant ainsi une accessibilité maximale.\r\n\r\nDe plus, le Service Clients joue un rôle essentiel en assurant une interface  avec les différentes entités au sein d\'Enedis. Cette collaboration fluide entre les divers services garantit une efficacité accrue dans la gestion des demandes. Le Service Clients agit également comme un guide, orientant les appels vers les services appropriés et informant les clients sur les étapes et les délais de traitement de leurs dossiers. ','22 rue du Laos, 75015 Paris','https://www.google.fr/maps/place/Espace+Grenelle+Enedis/@48.8488603,2.297629,17z/data=!3m1!4b1!4m6!3m5!1s0x47e67022f2d2afb1:0x740f4bb89afe6fa6!8m2!3d48.8488603!4d2.3002039!16s%2Fg%2F11dxqk22gc?entry=ttu','Raccordement Clients et Ingénierie','[\"florian.isak@enedis.fr\"]','13077615','08:30:00','16:00:00'),(4,'Batignolles','Cellule Pilotage des Activités',' La Cellule de Pilotage des Activités est une entité stratégique au sein du domaine opération, jouant un rôle central dans la coordination et l\'optimisation des activités. Elle est dédiée à la planification et à la gestion efficace des interventions des techniciens. Sa mission première est de programmer l\'ensemble des interventions des techniciens, ce qui implique une expertise pointue dans la gestion des plannings, des ressources, et des compétences.\r\n\r\nElle garantit également la fiabilité de la programmation des activités, assurant ainsi une exécution fluide et efficace des tâches opérationnelles.\r\n\r\nElle est chargée de contribuer à l\'optimisation globale des ressources et des compétences.\r\n\r\nElle intervient enfin dans la gestion des demandes d\'interventions urgentes et des avances de rendez-vous.\r\n\r\nElle opère un filtrage des interventions techniques, garantissant ainsi une priorisation adéquate et une réponse rapide aux besoins des clients.','13 Rue des Batignolles, 75017 Paris','https://www.google.fr/maps/place/Enedis/@48.883925,2.319848,17z/data=!3m1!4b1!4m6!3m5!1s0x47e66f8a3b7e0ce1:0x6dcf834ac03ec50b!8m2!3d48.883925!4d2.3224229!16s%2Fg%2F11f5vdvbhr?entry=ttu','Opérations',NULL,'13077360',NULL,NULL),(5,'Batignolles','ASGARD','Agence de Supervision et de Gestion des Accès Réseau et du Dépannage. L\'agence inclut la supervision du réseau BT, les Bureaux d\'Exploitation, les dépannages, et la conduite BT. Avec un déploiement de compteurs Linky à 93% à la maille DR PARIS, l\'ASGARD a une visibilité sur le réseau basse tension 24/24 et 7j/7 et a également pour mission de gérer l\'ensemble des dépannages sur le périmètre de la DR et de gérer les accès aux ouvrages sur le périmètre de la DR.','13 Rue des Batignolles, 75017 Paris','https://www.google.fr/maps/place/Enedis/@48.883925,2.319848,17z/data=!3m1!4b1!4m6!3m5!1s0x47e66f8a3b7e0ce1:0x6dcf834ac03ec50b!8m2!3d48.883925!4d2.3224229!16s%2Fg%2F11f5vdvbhr?entry=ttu','Opérations',NULL,'13077313',NULL,NULL),(6,'Italie','AISMA',' L\'Agence d\'Interventions Spécialisées Marché d\'Affaires (AISMA) a pour missions principales de répondre aux demandes de prestations des plus grands consommateurs parisiens, tels que l\'Élysée, les mairies, les ambassades, les restaurants et les bâtiments historiques.\r\n\r\nElle est également chargée d\'assurer toutes les opérations liées à la réception des informations de comptage électrique pour environ 28 500 clients du segment « Entreprise » (clients du segment C1-C4, d’une puissance supérieure à 36KVA), représentant près de la moitié de la consommation d\'énergie à Paris.','146 Rue de Tolbiac, 75013 Paris','https://www.google.fr/maps/place/Enedis/@48.8262142,2.3534463,17z/data=!3m1!4b1!4m6!3m5!1s0x47e6718f9b28bb95:0x82031cd69cc55251!8m2!3d48.8262142!4d2.3560212!16s%2Fg%2F11bbr9h_kf?entry=ttu','Raccordement Clients et Ingénierie',NULL,'13077516',NULL,NULL),(7,'Italie','ARMM','L\'Agence Raccordement Marché de Masse (ARMM) assure la maîtrise d\'ouvrage pour la réalisation des demandes C5 sur dérivation individuelle à Paris. Ces demandes proviennent de différents canaux tels que le portail de raccordement, les e-mails, le courrier et les demandes des fournisseurs. L\'ARMM réceptionne également les appels du service client liés aux demandes de raccordement. Elle est également chargée de la programmation des visites techniques, du suivi des branchements provisoires et des premières mises en service.','146 Rue de Tolbiac, 75013 Paris','https://www.google.fr/maps/place/Enedis/@48.8262142,2.3534463,17z/data=!3m1!4b1!4m6!3m5!1s0x47e6718f9b28bb95:0x82031cd69cc55251!8m2!3d48.8262142!4d2.3560212!16s%2Fg%2F11bbr9h_kf?entry=ttu','Raccordement Clients et Ingénierie','[\"par-are@enedis.fr\",\"prisca.velayouodn@enedis.fr\"]','13077575','08:30:00','16:30:00'),(12,'Italie','ARMA','L’ARMA est une agence au sein du domaine Raccordement Clients Ingénierie qui a pour mission de réaliser le raccordement de l’ensemble des professionnels parisiens sur une multitude de typologies de dossiers de raccordements BT et HTA : du restaurateur au raccordement des sites Olympiques et Paralympiques en passant par les bornes de recharge pour véhicules électriques. \r\nL’ARMA comprend une partie ‘Etudes’ qui réalise, pour l’ensemble des demandes clients basse tension sur Paris, la proposition de solution technique jusqu’à l’établissement des devis. Elle réalise ces études pour l’ARMA mais également de l’AIOC.\r\n \r\nElle comprend également, pour l’ensemble des affaires, des chargés de projets qui sont des véritables chefs d’orchestre des raccordements. Ils accompagnent les clients du premier rendez-vous client (PRIMO) jusqu’à la mise en service. C’est au sein de l’ARMA qu’est suivi le bon déroulement de l’ensemble des chantiers de raccordement de professionnels parisiens dans le respect des conditions de sécurité, des délais, du budget et des règles techniques.   \r\nN’hésitez pas à venir nous rencontrer, nous serons plus qu’heureux de vous faire découvrir nos métiers et vous partager nos passions \r\n',NULL,'A modifier','Raccordement Clients et Ingénierie',NULL,'13077578',NULL,NULL);
